function goToHelpSuggestionPage(){$.ajax({url:"/api/v2/post/go-to-help-and-suggestion-page",type:"POST",success:function(e){if(e.length>0){const a="https://meet.allworldtrade.com/join/"+e[0].communicator_link;window.open(a,"_blank"),occupied(e[0].communicator_link,e[0].support_accounts_uuid)}else{let e=UIkit.modal("#email-if-help-and-suggest-link-not-available-modal");e.show()}}})}function occupied(e,a){$.ajax({url:"/api/v2/post/update-as-occupied",type:"POST",data:{communicator_link:e,support_accounts_uuid:a},success:function(e){console.log(e)}})}function submitEmailIfHelpAndSuggestLinkNotAvailable(e){e.preventDefault();const a=$("#formEmailIfHelpAndSuggestLinkNotAvailable");$.ajax({url:"/api/v2/post/submit-email-if-help-and-suggest-link-not-available",type:"POST",data:a.serialize(),success:function(e){if(console.log(e),"message has been submitted successfully"===e.message){$("#email-if-help-and-suggest-link-not-available-modal form")[0].reset();var a=UIkit.modal("#email-if-help-and-suggest-link-not-available-modal");a.hide()}}})}document.getElementById("btnEmailIfHelpAndSuggestLinkNotAvailable").addEventListener("click",submitEmailIfHelpAndSuggestLinkNotAvailable),document.getElementById("btnHiddenEmailIfHelpAndSuggestLinkNotAvailable").addEventListener("click",submitEmailIfHelpAndSuggestLinkNotAvailable);